import React from 'react';
import '../styles/Carousel.css';

function Carousel(props) {
    return (
        <div className='carousel'>
            <img src='/pic.jpg' alt='project image' />
            <div className='controls'>
                <span>&lt; Previous</span>
                <span>Next &gt;</span>
            </div>
        </div>
    )
}

export default Carousel
